import Link from 'next/link';

const linkStyle = {
  marginRight: 15
};
const imgStyle = {
    height: '160px',
    marginRight: '100%'
}

const Header = () => (
  <div>
    <img src="/dkp.png" style={imgStyle}/>
    <Link href="/">
      <a style={linkStyle}>Home</a>
    </Link>
    <Link href="/about">
      <a style={linkStyle}>About</a>
    </Link>
    <Link href="/event">
      <a style={linkStyle}>Events</a>
    </Link>
  </div>
);

export default Header;
